  [],\n\t\"num_tags\": 0,\n\t\"name\": \"coral-reef-surveys-of-fagatele-bay-national-marine-sanctuary-and-other-sites-around-tutuila-ame\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Six permanent transects in Fagatele Bay
  National Marine Sanctuary, American Samoa, and 11 other sites around Tutuila Island
  were established in 1985. This dataset contains coral reef surveys taken in 1995
  and 1998 along these established transect lines. Data were taken on 30-m transects
  along isobaths on the reef platform and at depths of 3, 5, 9, and 12 m. Data on
  algae, fish, and macroinvertebrates were also collected by other investigators,
  but are not included with this data set. Data includes coral species, size distribution
  of colonies, frequency, density per 100m2, relative density, percent cover and relative
  cover.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
